webpackJsonp([25725431800017],{339:function(e,t){e.exports={data:{contentfulLesson:{title:"Week Two",week:2,content:{childMarkdownRemark:{html:"<p><strong>Read:</strong></p>\n<ul>\n<li>Two lessons about successfully changing your behavior that are not fun.</li>\n<li>What is your story? Sabotaging thoughts and 2 strategies to overcome them.</li>\n<li>Challenge yourself: The secret to living fully as we age.</li>\n</ul>\n<p><strong>Objective:</strong></p>\n<ul>\n<li>At the end of this week you should have created a list of your “if only” statements that are associated with your goal.</li>\n<li>At the end of this week you should have created a list of your “I wish” statements that are associated with your goal.</li>\n<li>At the end of this week you should have a list of sabotaging thoughts that you’ve had in relation to your goal.</li>\n<li>At the end of this week you should have created 2 strategies for managing your mindset and overcoming negative thoughts.</li>\n<li>At the end of this week you will begin a daily practice, utilizing one of the strategies that you created to overcome negative thoughts.</li>\n<li>At the end of this week you will begin participating in a Challenge Day.</li>\n</ul>\n<p><strong>Activities:</strong></p>\n<p><em>Day Eight:</em></p>\n<ul>\n<li>Complete your daily habit and log it</li>\n<li>Read: <em>[Two lessons about successfully changing your behavior that are not fun.]({{ site.baseurl }}{% post_url 2017-09-25-two-lessons-about-changing-your-behavior %})</em></li>\n<li>List 3 “if only” statements that you have said or thought as it relates to your goal.</li>\n</ul>\n<p><em>Day Nine:</em></p>\n<ul>\n<li>Complete your daily habit and log it</li>\n<li>List 3 “I wish” statements that you have thought, as you have imagine your attempt to meet your goal.</li>\n</ul>\n<p><em>Day Ten:</em></p>\n<ul>\n<li>Complete your daily habit and log it</li>\n<li>List 5 thoughts that you’ve had that are likely to sabotage your progress towards meeting your goal.</li>\n</ul>\n<p><em>Day Eleven:</em></p>\n<ul>\n<li>Complete your daily habit and log it</li>\n<li>Read: <em>[What is your story? Sabotaging thoughts and 2 strategies to overcome them.]({{ site.baseurl }}{% post_url 2017-09-25-what-is-your-story-sabotaging-thoughts %})</em></li>\n<li>\n<p>Strategy One:</p>\n<ul>\n<li>Find a mantra that has personal meaning.</li>\n</ul>\n</li>\n</ul>\n<p><em>Day Twelve:</em></p>\n<ul>\n<li>Complete your daily habit and log it</li>\n<li>\n<p>Strategy Two:</p>\n<ul>\n<li>Determine a powerful visualization that you can use when negative thoughts are interfering with your health and happiness.</li>\n</ul>\n</li>\n</ul>\n<p><em>Day Thirteen:</em></p>\n<ul>\n<li>Complete your daily habit and log it</li>\n<li>Pick one of the strategies that you developed over the past two days to practice each day over the remainder of the program.</li>\n<li>Take 5 minutes and practice the strategy you choose.</li>\n</ul>\n<p>*Day Fourteen: <strong>Challenge Day*</strong></p>\n<ul>\n<li>Read: <em>[Challenge yourself: The secret to living fully as we age, along with 10 things you can try today.]({{ site.baseurl }}{% post_url 2017-09-25-challenge-yourself %})</em></li>\n<li>Find a challenge activity and complete it, log your challenge</li>\n<li>Complete your daily habit and log it</li>\n<li>Take 5 minutes and practice your mantra or visualization</li>\n</ul>"}}},allContentfulLesson:{edges:[{node:{title:"Week One",week:1,slug:"week-one",youtube:"https://www.youtube.com/playlist?list=PLAg5pHvM_nE3fE0QsmYRIk9z3tW5ovgEg",soundcloud:"https://soundcloud.com/user-335920184/sets/happier-and-healthier-you"}},{node:{title:"Week Two",week:2,slug:"week-two",youtube:"https://www.youtube.com/playlist?list=PLAg5pHvM_nE3fE0QsmYRIk9z3tW5ovgEg",soundcloud:"https://soundcloud.com/user-335920184"}},{node:{title:"Week Three",week:3,slug:"week-three",youtube:"https://www.youtube.com/playlist?list=PLAg5pHvM_nE3fE0QsmYRIk9z3tW5ovgEg",soundcloud:"https://soundcloud.com/user-335920184"}},{node:{title:"Week Four",week:4,slug:"week-four",youtube:"https://www.youtube.com/playlist?list=PLAg5pHvM_nE3fE0QsmYRIk9z3tW5ovgEg",soundcloud:"https://soundcloud.com/user-335920184/sets/happier-and-healthier-you"}}]}},pathContext:{slug:"week-two"}}}});
